import React from 'react';
import "./landingPic.css"

function landingPic(){
    var video = document.getElementById("video_background");

    video.addEventListener("canplay", function() {
        setTimeout(function() {
          video.play();
        }, 5000);
      });

    return(
        <div id='LP'>
            <div className='contain'>
                <video id='video_background' src="videos/landingVid.mp4" controls="controls" preload="true" autoPlay muted playsInline loop></video>
            </div>
        </div>
    );
}

export default landingPic;
